// menuitems.js
import React from 'react';
import styles from './styles.module.css'; // Import CSS module styles

const MenuItems = () => {
  const menuItems = [
    { id: 1, icon: 'account.png', name: 'Item 1' },
    { id: 2, icon: 'conductivity.png', name: 'Item 2' },
    { id: 3, icon: 'home.png', name: 'Item 3' },
    { id: 4, icon: 'PH.png', name: 'Item 4' },
    { id: 5, icon: 'setting.png', name: 'Item 5' },
    { id: 6, icon: 'standards.png', name: 'Item 6' },
    { id: 7, icon: 'temperature.png', name: 'Item 7' },
    { id: 8, icon: 'turbidity.png', name: 'Item 8' },
  ];

  return (
    <div className={styles.menu}>
      {menuItems.map(item => (
        <div key={item.id} className={styles.menuItem}>
          <img src={`/images/${item.icon}`} className={styles.icon} alt={item.name} />
          <div className={styles.name}>{item.name}</div>
        </div>
      ))}
    </div>
  );
};

export default MenuItems;
